import navLogo from "./navLogo.png";
import ccaccLogo from "./ccaccLogo.png";
// import navLogo1 from "./navLogo1.png";
import "./Nav.css";

const Nav = () => {
  return (
    <div className="nav">
      <img src={ccaccLogo} className="nav-logo" />
      <p>Log out</p>
    </div>
  );
};

export default Nav;
